import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './nav.css';

function Nav(props) {
  const linkAdd = props.adds;
  const linkTitle = props.titles;
  const linkAdds = linkAdd.map((link) =>
    <li>
      <a class='nav-link'>
        {link.title}
      </a>
    </li>
  );

  return (
    <div class="navbar">
        <ul class="nav">
          {linkAdds}
        </ul>
      </div>
  );
}

export default Nav;
